import { useState } from "react";
import { RangeSlider } from "reactrangeslider";
import useScript from "../hooks/use-script";
import useLink from "../hooks/use-link";

const SliderRange = () => {
  useScript("https://code.jquery.com/jquery-1.11.3.min.js");
  useScript("https://code.jquery.com/mobile/1.4.5/jquery.mobile-1.4.5.min.js");
  useLink("https://code.jquery.com/mobile/1.4.5/jquery.mobile-1.4.5.min.css");
  return (
    <html>
      <head></head>
      <body>
        <div data-role="page">
          <div data-role="header">
            <h1>Range Slider</h1>
          </div>


            <div data-role="rangeslider">
              <label for="price-min">Price:</label>
              <input
                type="range"
                name="price-min"
                id="price-min"
                value="200"
                min="0"
                max="1000"
              />
              <label for="price-max">Price:</label>
              <input
                type="range"
                name="price-max"
                id="price-max"
                value="800"
                min="0"
                max="1000"
              />
            </div>
        </div>
      </body>
    </html>
  );
};

export default SliderRange;
